def plugin_loaded():
  for c in constants_raw: CONS.append(('c' + c + '\tgCon', c))
  load_procs()
  PROCS.extend(other_procs)

def load_procs():
  args_lbls = procs_raw[0]
  proc_prfxs_lbls = procs_raw[1]
  for proc in procs_raw[2:]:
    name_net = proc[1]
    catgry = proc[0]
    name_full = name_net if catgry == -1 else proc_prfxs_lbls[catgry] + name_net
    name_trgr = 'f' + name_net + '\tgFun'
    if len(proc) == 3:
      args_inxs = proc[2]
      proc_args = ''
      for i, x in enumerate(args_inxs): proc_args += ('${%d:%s}, ' % (i + 1, args_lbls[x]))
      PROCS.append((name_trgr, 'pdb.' + name_full + '('+ proc_args[:-2] +')'))
    else:
      PROCS.append((name_trgr, 'pdb.' + name_full + '()'))

class GimpAutoCompletePython(sublime_plugin.EventListener):

  def on_query_completions(self, view, prefix, locations):
    if view.match_selector(locations[0], 'source.python - string - comment'):
      p = prefix[0]
      return PROCS if p == 'f' else CONS if p == 'c' else None
    return None

